import React from 'react'
import { observer } from "mobx-react-lite";

export const Pagination = observer(({ countriesPerPage, totalProduct, gsergserg}) => {
    console.log(countriesPerPage);
    const pageNumbers = []

    for (let i = 1; i <= Math.ceil(totalProduct / countriesPerPage); i++) {
        pageNumbers.push(i)
    }
    console.log(Math.ceil(totalProduct / countriesPerPage));
    console.log(pageNumbers);
    return (
        <div>
            <ul className="pagination">
                {
                    pageNumbers.map(number => (
                        <li onClick={gsergserg(1)} className="page-item" key={number}>
                                {number}
                        </li>
                    ))
                }
            </ul>
        </div>
    )
})
